@latimeralder If you're unvaxxed your chance of "testing positive" for #SARSCoV2 (tests are iffy) is 1 in 100.

The odds of someone under 70 in good health dying of covid are 1 in 5000. Far lower if they're under 50.

The risk (understated / hushed up) of dying of #CovidVaccine is 1 in 40000.
